import React, { useState } from "react";
import { render } from "react-dom";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const opa = () => {
  return (
  <>
    <form>
    <TextField label="Juros Anual Simples" variant="outlined" />
    <TextField label="Juros ao Mês Simples" variant="filled" />
    </form>
  </>
  );
};

render(<opa />, document.querySelector("#root"));

const CompoundInterest2 = () => {
  return (
  <>
    <form>
    <TextField label="Juros Anual Composto" variant="outlined" />
    <TextField label="Juros ao Mês Composto" variant="filled" />
    </form>
  </>
  );
};



render(<CompoundInterest2 />, document.querySelector("#root2"));
